2. **减法方法 (subtract)**
   - 功能：接收两个整数参数，返回第一个参数减去第二个参数的结果。
   - 示例：`subtract(10, 5)` 返回 5。

3. **乘法方法 (multiply)**
   - 功能：接收两个整数参数，返回它们的乘积。
