package com.leetcode;

import java.util.ArrayList;
import java.util.List;

public class Solution_22 {
    public List<String> generateParenthesis(int n) {
        List<String> result = new ArrayList<>();
        dfs(result, new StringBuilder(), 0, 0, n);
        return result;
    }

    private void dfs(List<String> result, StringBuilder stringBuilder, int leftCount, int rightCount, int n) {
        if (leftCount == n && rightCount == n) {
            result.add(stringBuilder.toString());
            return;
        }
        if (leftCount < n) {
            stringBuilder.append("(");
            dfs(result, stringBuilder, leftCount + 1, rightCount, n);
            stringBuilder.deleteCharAt(stringBuilder.length() - 1);
        }
        if (rightCount < leftCount) {
            stringBuilder.append(")");
            dfs(result, stringBuilder, leftCount, rightCount + 1, n);
            stringBuilder.deleteCharAt(stringBuilder.length() - 1);
        }
    }
}
package com.leetcode.algorithm.medium.permutationsequence;

import java.util.ArrayList;
import java.util.List;

class Solution {
  public String getPermutation(int n, int k) {
    List<Integer> nums = new ArrayList<>();
    for (int i = 1; i <= n; i++) {
      nums.add(i);
    }

    int[] fact = new int[n];
    fact[0] = 1;
    for (int i = 1; i < n; i++) {
      fact[i] = i * fact[i - 1];
    }

    k = k - 1;
    StringBuilder sb = new StringBuilder();
    for (int i = n - 1; i >= 0; i--) {
      int index = k / fact[i];
      k = k % fact[i];
      sb.append(nums.get(index));
      nums.remove(index);
    }

    return sb.toString();
  }
}
