    StringBuilder sb = new StringBuilder();
    for (int i = n - 1; i >= 0; i--) {
      int index = k / fact[i];
      k = k % fact[i];
      sb.append(nums.get(index));
      nums.remove(index);
    }

    return sb.toString();
  }
}
